import logo from './logo.svg';
import './App.css';
import socketIO from 'socket.io-client';
import {useEffect} from "react"

const WS = 'http://localhost:8080';


function App() {
  useEffect(() => {
    socketIO(WS);
  }, []);
  return (
    <div className="App">
      <button>Create a room</button>
    </div>
  );
}

export default App;
